import React from 'react'
import {Button} from '@mui/material'

function GroupChatModal() {

    return (
        <Box onClick= {handleCreateRoom} sx={{ border: "1px solid", borderRadius: "3px", margin: "3% 0%", alignItems: "center", display: "flex", flexWrap: "wrap", padding: "2%", cursor: 'pointer' }}>
        <Button variant='overline' fontSize="1rem">Create a room</Button>
        <ChevronRightIcon sx={{ float: "right", marginLeft: "auto" }} />
      </Box>
    )
}

export default GroupChatModal
